import cProfile

def example_three_cProfile(array):
    counter = {}
    frequency = 1
    num = None

    for item in array:
        sort_number(counter, item)

        compare_number(counter, frequency, item)


def sort_number(counter, item):
    if item in counter:
        counter[item] += 1
    else:
        counter[item] = 1


def compare_number(counter, frequency, item):
    if counter[item] > frequency:
        frequency = counter[item]
        num = item


